import React from 'react';
function Education() {
    return ( 
        <div className="container">
            <div className="row">
                <div className='col-6'>
                    <img src="images/education.svg" alt="education" style={{width:"80%", marginRight:"500px"}}/>
                </div>
                <div className='col-6'>
                    <h1 className='mb-4 fs-3 mt-5'style={{marginLeft:"-50px",marginTop:"50px"}}>Free and open market education</h1>
                    <p style={{marginLeft:"-50px",width:"87%",fontSize:"17px"}}>Varsity, the largest online stock market education book in the world covering everything from the basics to advanced trading.</p>
                    <a href='' style={{textDecoration:"none",fontSize:"17px",marginLeft:"-50px"}}>Varsity <i className="fa fa-long-arrow-right p-2"></i></a>
                    <p className='mt-3'style={{width:"87%",fontSize:"17px",marginLeft:"-50px"}}>TradingQ&A, the most active trading and investment community in India for all your market related queries.</p>
                    <a href='' style={{textDecoration:"none",fontSize:"17px",marginLeft:"-50px"}}>TradingQ&A <i className="fa fa-long-arrow-right p-2"></i></a>
                </div>
            </div>

        </div>
     );
}

export default Education;
